export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},cHM7pdTh8Y:{data:{id:695,attributes:{imdbId:"tt0065579",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZDFkNWUwYzEtNDM3ZS00NjAyLWFjZjgtYWRjZmJmNzZjNzJlL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNzc5MjA3OA@@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.5\u002F10"}],item_lang:{data:{id:1358,attributes:{title:e,plot:"Gravedigger Jones and Coffin Ed Johnson are two black cops with a reputation for breaking the odd head. Both are annoyed at the success of the Reverend Deke O'Mailey who is selling trips back to Africa to the poor on the installment plan. When his truck is hijacked and a bale of cotton stuffed with money is lost in the chase, Harlem is turned upside down by Gravedigger and Coffin Ed, the Reverend, and the hijackers. Much of the humor is urban black, which was unusual in 1970.",slug:"cotton-comes-to-harlem"}}},books:{data:[{id:716,attributes:{title:e,description:h,thumbnail:i,authors:[c],firstBook:true,published:j,publisher:k,subtitle:a}},{id:717,attributes:{title:e,description:h,thumbnail:i,authors:[c],firstBook:d,published:j,publisher:k,subtitle:a}},{id:718,attributes:{title:"Conversations with Chester Himes",description:"Collected interviews with the celebrated African American novelist",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=GU9L8KEz5W0C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Chester B. Himes"],firstBook:d,published:"1995-01-01",publisher:"Univ. Press of Mississippi",subtitle:a}},{id:719,attributes:{title:"Blind Man with a Pistol",description:"At once grotesquely comic and unflinchingly violent, Blind Man With a Pistol is the final entry in Chester Himes's trailblazing Harlem Detectives series. New York is sweltering in the summer heat, and Harlem is close to the boiling point. To Coffin Ed Johnson and Grave Digger Jones, at times it seems as if the whole world has gone mad. Trying, as always, to keep some kind of peace—their legendary nickel-plated Colts very much in evidence—Coffin Ed and Grave Digger find themselves pursuing two completely different cases through a maze of knifings, beatings, and riots that threaten to tear Harlem apart.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=HbvztcgUjGgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2011-07-27",publisher:"Vintage Crime\u002FBlack Lizard",subtitle:a}},{id:720,attributes:{title:"The Big Gold Dream: The Classic Crime Thriller",description:"“Himes is a writer with an enormous capacity to record sensuous life as it is experienced from one moment to the next.” — New York Times After arriving on the American literary scene with novels of scathing social protest like If He Hollers Let Him Go and The Lonely Crusade, Chester Himes created a pioneering pair of dangerously effective African-American sleuths, Grave Digger Jones and Coffin Ed Johnson, Harlem’s toughest detective duo, who must carry the day against an absurdist world of racism and class warfare. The Big Gold Dream is the explosive and shocking hardboiled classic that explores the shadowy underbelly of New York as an urban civil war erupts on the side streets of Harlem, pitting murderers and prostitutes against corrupt politicians and racist white detectives. Grave Digger Jones and Coffin Ed Johnson attempt to maintain some kind of order—in the neighborhood they have sworn to protect—in a world gone mad around them.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=6vpaBAAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2008-09-17",publisher:"Simon and Schuster",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681377266104}}("","movie","Chester Himes",null,"Cotton Comes to Harlem","series",1,"A preacher called Deke O'Malley's been selling false hope: the promise of a glorious new life in Africa for just $1,000 a family. But when thieves with machine guns steal the proceeds - and send one man's brain matter flying - the con is up. Now Grave Digger Jones and Coffin Ed mean to bring the good people of Harlem back their $87,000, however many corpses they have to climb over to get it. Cotton Comes to Harlem is a non-stop ride, with violence, sex, double-crosses, and the two baddest detectives ever to wear a badge in Harlem. With a new Introduction by Will Self.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=NMoR66xQSvgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2011-05-05","Penguin UK"))